        <input type="text" id="search-box" placeholder="Search...">  
        <button onclick="searchData()">Search</button>  
        <div id="results"></div>   
          
            <script>  
                function searchData() {  
                    const searchTerm = document.getElementById('search-box').value;  
                    const url = `http://localhost:3000/search?term=${searchTerm}`; // 后端API地址  
          
                    fetch(url)  
                        .then(response => response.json())  
                        .then(data => {  
                            const resultsDiv = document.getElementById('results');  
                            resultsDiv.innerHTML = ''; // 清空之前的结果  
                            data.forEach(row => {  
                                const p = document.createElement('p');  
                                // 假设row是一个对象，我们可能需要提取一些特定的属性来显示  
                                // 例如，如果row有title和description属性，可以这样显示：  
                                p.textContent = `专业: ${row.专业}\n作品名称: ${row.作品名称}`;  
                                // 如果row是一个简单的字符串或数字，可以直接显示：  
                                // p.textContent = row;  
                                // 如果row是一个复杂的对象或数组，你可能想要格式化它以更易读的方式显示  
                                // 例如，使用JSON.stringify并加上适当的缩进  
                                // p.textContent = JSON.stringify(row, null, 2);  
                                resultsDiv.appendChild(p);  
                            });  
                        })  
                        .catch(error => {  
                            console.error('Error fetching data:', error);  
                            // 可以在这里添加一些用户界面反馈，告诉用户发生了错误  
                            const errorMsg = document.createElement('p');  
                            errorMsg.textContent = 'Error fetching data. Please try again later.';  
                            document.getElementById('results').appendChild(errorMsg);  
                        });  
                    // 不再需要displayResults的调用，因为逻辑已经包含在上述代码中  
                }  
            </script>
